window.bookSummaryJSON = "<p>RITA Award winner Irene Hannon has also won the Holt Medallion and the Daphne du Maurier Award for her romantic suspense. U.S. Marshal Jake Taylor loathes guarding federal judge Liz Michaels. How can he protect the coldhearted workaholic who drove herlate husband, Jake’s best friend, to suicide? But as he gets to know Liz better, his heart—and her life—are soon in danger.</p>"; 
